import React from 'react';
import ReactDOM from 'react-dom/client';
import './style.css'

function Panel({children}){
    return(
        <div className='panel'>{children}</div>)
}

function App(){
    return(
        <main>
            <Panel>oui</Panel>
        </main>
    )
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App></App>);
